Location.prototype.find	= function(id) {
	if(typeof(this.items[id]) == "undefined")
		return false;
	return this.items[id];
}

Location.prototype.fillOption	= function(el_id , loc_id , selected_id) {
	var el	= $(el_id);
	
	var json	= this.find(loc_id);
	
	if (json) {
		$.each(json , function(k , v) {
			if(v==selected_id){
				var option	= '<option selected="selected" value="'+k+'">'+v+'</option>';
			}else{
			var option	= '<option value="'+k+'">'+v+'</option>';
				
			}
			el.append(option);
		})
	}
}
Location.prototype.fillOptionId	= function(el_id , loc_id , selected_id) {
	var el	= $(el_id);
	
	var json	= this.find(loc_id);
	
	if (json) {
		$.each(json , function(k , v) {
			if(k==selected_id){
				var option	= '<option selected="selected" value="'+k+'">'+v+'</option>';
			}else{
			var option	= '<option value="'+k+'">'+v+'</option>';
				
			}
			el.append(option);
		})
	}
}

function showLocation(province , city , town,sheng,shi,qu) {
	var loc	= new Location();
	var title	= ['省份' , '地级市' , '区域'];
	$.each(title , function(k , v) {
		title[k]	= '<option value="">'+v+'</option>';
	})
	
	$(sheng).append(title[0]);
	$(shi).append(title[1]);
	$(qu).append(title[2]);
	
	
	$(sheng).change(function() {
		$(shi).empty();
		$(shi).append(title[1]);
		loc.fillOption(shi, '0,'+$(sheng).val());
		$(shi).find('option').eq(0).attr('selected','selected');
		$(qu).empty();
		$(qu).append(title[2]);
	})
	
	$(shi).change(function() {
		$(qu).empty();
		$(qu).append(title[2]);
		loc.fillOption(qu , '0,' + $(sheng).val() + ',' + $(shi).val());
		$(qu).find('option').eq(0).attr('selected','selected');
	})
	
	$(qu).change(function() {
		//$('input[@name=location_id]').val($(this).val());
	})
	
	if (true) {
		loc.fillOption(sheng , '0' , province);
		if (true) {
			var sv = $(sheng).val();
			loc.fillOption(shi , '0,'+sv , city);
			var shiv = $(shi).val();
			if(shiv && !town){
				loc.fillOption(qu , '0,'+sv+','+shiv , '0');
			}else{
				loc.fillOption(qu , '0,'+sv+','+shiv , town);
			}
		}
		
	} else {
		loc.fillOption(sheng , '0');
		$(sheng).find('option').eq(0).attr('selected','selected');
	}
		
}

