function getProvinceName(id){
	var loc = new Location();
	var proName = loc.items['0'][id];
	return proName == undefined ? "" : proName;
}

function getCityName(pid,cid){
	var loc = new Location();
	var key = '0,'+pid;
	var cityName = loc.items[key][cid]
	return cityName == undefined ? "" : cityName;
}